class Landing {
    constructor() {
        // IMPORT DARI FILE BAHASA
        this.trans = window.TokkoSettings[userState.last_lang];
        // AMBIL CLASS CONTAINER DARI HTML
        this.container = document.querySelector(".container");
        this.containerchat = document.querySelector(".container .Tokkochat");
        this.containerprofil = document.querySelector(".container .Tokkoprofil");
        this.containercover = document.querySelector(".container .Tokkocover");
        this.containerpesan = document.querySelector(".container .Tokkopesan");
        this.containerlogin = document.querySelector(".container .login");

    }

    createElement() {
        // BIKIN DIV BARU DENGAN CLASS "LANDING"
        document.querySelector(".warningH").remove();
        document.querySelector(".menu-tokko").remove();
        document.querySelector(".menu-s").remove();
        document.querySelector(".ontokko").remove();
        this.element = document.createElement("div");
        this.element.classList.add("Landing");
        // ISI DARI "LANDING"
        this.element.innerHTML = (`
            <div class="tokkoLogo" style="background-image: url(${this.trans.Tokko.tokkoLogo});background-position: center;background-size: cover;width:100%;min-height:85px;"></div>
            <h2 class="Title">${this.trans.Tokko.titleTokko}</h2>
            <div class="Desc">${this.trans.Landing.titleLogin}</div>

                <button class="button chooseEmail"><svg class="line" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">${this.trans.TokkoSVG.Maillogo}</svg>${this.trans.Landing.titleLoginMail}</button>

            <div class="btnF">
                <button class="button loginGoogle"><svg viewBox="0 0 24 24">${this.trans.TokkoSVG.Googlelogo}</svg> ${this.trans.Landing.titleLoginGoogle}</button>

                <button class="button loginGithub"><svg viewBox="0 0 24 24">${this.trans.TokkoSVG.Githublogo}</svg> ${this.trans.Landing.titleLoginGithub}</button>
            </div>
        `);
         
        this.githubLogin = this.element.querySelector(".loginGithub");
        this.githubLogin.onclick = () => {
            const provider = new firebase.auth.GithubAuthProvider()
        
            userState.changeLast("first");
            new Activity().save();
            // LOGIN DENGAN POPUP  -- KALO REDIRECT PAKE: signInWithRedirect() --
            auth.signInWithPopup(provider);
        }

        this.googleLogin = this.element.querySelector(".loginGoogle");
        this.googleLogin.onclick = () => {
            const provider = new firebase.auth.GoogleAuthProvider()
        
            userState.changeLast("first");
            new Activity().save();
            // LOGIN DENGAN POPUP  -- KALO REDIRECT PAKE: signInWithRedirect() --
            auth.signInWithRedirect(provider);
        }
        // LISTENER KALO KLIK LOGIN EMAIL
        this.chooseEmail = this.element.querySelector(".chooseEmail");
        this.chooseEmail.onclick = () => this.emailElement(this.element);
    }

    emailElement(chooser) {
        // DIV BARU
        this.mailElement = document.createElement("div");
        this.mailElement.classList.add("Landing");
        this.mailElement.innerHTML = (`
            <div class="tokkoLogo" style="background-image: url(${this.trans.Tokko.tokkoLogo});background-position: center;background-size: cover;width:100%;min-height:85px;"></div>
            <div class="Title flex gap20 center"><span>${this.trans.Landing.tokkoLogin}</span><svg class="line" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">${this.trans.TokkoSVG.Maillogo}</svg></div>
            <div class="Desc">${this.trans.Landing.tokkoTextLogin}</div>
            <div class="Tombol">
                <input type="text" placeholder="Email" data-inpt="email" required />
                <input type="text" placeholder="Password" data-inpt="password" required />
    			 <p class="note">Email: user@gmail.com<br/>Password: 12345678<br/><br/>
Email: premium@tokkoblogger.com<br/>Password: 12345678<br/><br/>
Email: banned@tokkoblogger.com<br/>Password: 12345678</p>
                <button class="btn-1 hijau loginEmail gap20 center"><svg class="line" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">${this.trans.TokkoSVG.Loginlogo}</svg><span>${this.trans.Landing.tokkoLogin}</span></button>
            </div>
            <div class="reg">
                ${this.trans.Landing.tokkoNoAccount} <span>${this.trans.Landing.tokkoCreateAccount}</span>
            </div>
        `);
        const email = this.mailElement.querySelector(`.Tombol [data-inpt="email"]`);
        const password = this.mailElement.querySelector(`.Tombol [data-inpt="password"]`);

        this.mailElement.querySelector(".reg span").onclick = () => this.registerElement(this.mailElement); 
        this.mailElement.querySelector('.loginEmail').onclick = () => 
        this.login(email, password); 
        chooser.remove(); 
 this.containerlogin.appendChild(this.mailElement); 
    }

    login(email, password) {
        // LOGIN HANDLER DENGAN EMAIL DAN PASSWORD
        auth.signInWithEmailAndPassword(email.value, password.value).catch((err) => Notipin.Alert({
            msg: err.message,
            mode: "dark"
        })).then(() => {
             return
        }); // KALO ADA ERROR TAMPILKAN DI ALERT
        if (auth.currentUser) {
        Notipin.Alert({
            msg: this.trans.Landing.tokkoRegisWelcome,
            mode: "dark"
        })
         new Profil(auth.currentUser.uid).init(this.containerprofil);
            window.location.href = '/p/profile.html';
           } else {
            return
        }
    }

    registerElement(loginElement) {
        // DIV BARU
        this.regElement = document.createElement("div");
        this.regElement.classList.add("Landing");
        this.regElement.innerHTML = (`
            <div class="tokkoLogo" style="background-image: url(${this.trans.Tokko.tokkoLogo});background-position: center;background-size: cover;width:100%;min-height:85px;"></div>
            <div class="Title">${this.trans.Landing.tokkoRegis}</div>
            <div class="Desc">${this.trans.Landing.tokkoTextRegis}</div>
            <div class="Tombol">
                <input placeholder="Email" data-inpt="email" type="email" required />
                <input placeholder="Password" data-inpt="password" type="password" required />
                <input type="text" placeholder="${this.trans.Landing.tokkoRegisCon}" data-inpt="cPassword" type="password" required />

                <button class="btn-1 registerEmail gap20 center"><svg class="line" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">${this.trans.TokkoSVG.Loginlogo}</svg><span>${this.trans.Landing.tokkoRegis}</span></button>
            </div>
            <div class="reg">
                ${this.trans.Landing.tokkoRegisAccount} <span>${this.trans.Landing.tokkoRegisLogin}</span>
            </div>
        `);

       
        const email = this.regElement.querySelector(`.Tombol [data-inpt="email"]`);
        const password = this.regElement.querySelector(`.Tombol [data-inpt="password"]`);
        const cPassword = this.regElement.querySelector(`.Tombol [data-inpt="cPassword"]`);

        this.regElement.querySelector(".reg span").onclick = () => this.emailElement(this.regElement); // LISTENER KLIK MASUK AKUN
        this.regElement.querySelector(".registerEmail").onclick = () => this.register(email, password, cPassword); // LISTENER KLIK REGISTER
        loginElement.remove(); // HAPUS ELEMENT SEBELUMNYA

        this.containerlogin.appendChild(this.regElement); // MASUKKIN KE CONTAINER
    }

    register(email, password, cPassword) {
        if(email.value == '' || password.value == "" || cPassword.value == "") return Notipin.Alert({
            msg: this.trans.Landing.tokkoRegisFill,
            type: "danger",
            mode: "dark"
        }); // KALO ADA SALAH SATU YANG KOSONG AKAN ADA ALERT
        if(password.value.length < 6) return Notipin.Alert({
            msg: this.trans.Landing.tokkoRegisMin,
            type: "danger",
            mode: "dark"
        }); // KALO PASSWORD KURANG DARI 8 KARAKTER AKAN ADA ALERT
        if(password.value !== cPassword.value) return Notipin.Alert({
            msg: this.trans.Landing.tokkoRegisNotsamePassword,
            type: "danger",
            mode: "dark"
        }); 
        auth.createUserWithEmailAndPassword(email.value, cPassword.value).catch((err) => Notipin.Alert({
            msg: err.message,
            mode: "dark"
        })); // KALO ADA ERROR, TAMPILKAN DI ALERT
        if (auth.currentUser.uid) {
           Notipin.Alert({
              msg: this.trans.Landing.tokkoRegisDone,
              mode: "dark"
           })
              new Profil(auth.currentUser.uid).init(this.containerprofil);
              window.location.href = '/p/profile.html';
           }
    }


    end() {
        const header = this.container.querySelector(".header");
        const navbar = this.container.querySelector(".navbar");
        const profil = this.containerprofil.querySelector(".Profil");
        const cover = this.containerprofil.querySelector(".Cover");
        const chat = this.container.querySelector(".Chat"); // .Chat
        const listchat = this.containerchat.querySelector(".TokkoChat"); // TokkoChat
        const listpost = this.container.querySelector(".Tokkoactivity");
        const liststore = this.container.querySelector(".Tokkostore");
        const library = this.container.querySelector(".Library");

        // HAPUS JIKA ADA ELEMENT
        if (this.element) { this.element.remove() };
        if (profil) {profil.remove()};
        if (library) { library.remove() };
        if (new Dashboard().opsi === true) new Dashboard().opsi = false;
    }

    init() {
        // BERSIHKAN TERLEBIH DAHULU SEMUANYA
        this.end();
        // PERINTAHKAN UNTUK BIKIN DIV BARU
        this.createElement();
        // SURUH DIV TERSEBUT MASUK DI DALAM ELEMENT CONTAINER
        this.containerlogin.appendChild(this.element);
    }
}




